import React from 'react';

export default function VideoList({ videos, onVideoSelect }) {
    const a = () => {
        console.log(videos);
    };

    return (
        <div>
            <button onClick={a}>Button</button>
            {videos.map((v) => {
                return <li>{v}</li>;
            })}
        </div>
    );
}
